import * as React from "react";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid"; // Import the Grid component

export default function Internship() {
  return (
    <Grid container spacing={2}> {/* Use a Grid container */}
      <Grid item xs={6}> {/* Create a grid item for the first card */}
        <Card sx={{ maxWidth: 345 }}>
          <CardHeader title="Shrimp and Chorizo Paella" />
          <CardMedia
            component="img"
            height="194"
            image="/static/images/cards/paella.jpg"
            alt="Paella dish"
          />
          <CardContent>
            <Typography variant="body2" color="text.secondary">
              This impressive paella is a perfect party dish and a fun meal to cook
              together with your guests. Add 1 cup of frozen peas along with the
              mussels, if you like.
            </Typography>
          </CardContent>
        </Card>
      </Grid>

      <Grid item xs={6}> {/* Create a grid item for the second card */}
        <Card sx={{ maxWidth: 345 }}>
          <CardHeader title="Another Dish" /> {/* You can customize the second card similarly */}
          <CardMedia
            component="img"
            height="194"
            image="/static/images/cards/another-dish.jpg"
            alt="Another dish"
          />
          <CardContent>
            <Typography variant="body2" color="text.secondary">
              Description of another dish.
            </Typography>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
  );
}
